import React from 'react'
import Card from '@material-ui/core/Card'

const MenuLink = (props) => {
	
	return (
		<Card className="menulink noselect" style={{
			height:120,
			background:"#f1f1f1",
			textAlign: "center",
			display: "flex",
			textDecoration:"none",
			width:400

		}}>
			<h1>{props.titel}</h1>
			<button>{props.beschreibung}</button>
		</Card>
	)
}

export default MenuLink
